Téléchargez gratuitement l’application mobile de Métro.  JournalMetro.com est maintenant disponible en application.  L’appli vous propose gratuitement toutes les nouvelles de l’heure, 100% locales, de Montréal et du Québec. Métro suit l’actualité de Montréal et de chacun de ses arrondissements. Métro c’est : la culture 100% locale, les arts et spectacles, le lifestyle, manger et boire à Montréal, l’entrepreneuriat et l’emploi, mais aussi des dossiers sur les grands sujets de société et environnementaux. 

En résumé l’application Métro vous offre : 
    - Plus de 1200 nouveaux articles par mois ; 
    - Des nouvelles d’actualité, de politique, de culture, d’inspiration, des quartiers et plus ; 
    - Une salle de rédaction de 40 journalistes ; 
    - M local : des raccourcis vers les nouvelles de chaque quartier de Montréal ; 
    - Mes favoris : l’enregistrement d’articles pour lecture différée ;  
    - Recommandés : utiliser l’étoile afin de sélectionner le contenu qui vous intéresse ; 
    - Vidéos : nos vidéos d’actualité ainsi que nos grandes entrevues ; 
Toute l’actualité locale à un seul endroit. 
    - M local : regroupe l’actualité des zones suivantes : Ahuntsic-Cartierville, Côte-des-neiges & NDG, Hochelaga-Maisonneuve, IDS-Verdun, Lachine & Dorval, Lasalle, Le Plateau-Mont-Royal, Mercier & Anjou, Montréal-Nord, Ouest-de-l'île, Outremont & Mont-Royal, Pointe-aux-Trembles et Montréal-Est, Rivière-des-Prairies, Rosemont, Saint-Laurent, Saint-Léonard, Sud-Ouest, Vaudreuil-Soulanges, Ville-Marie, Villeray - Parc ex - Petite-Patrie ; 
    - Un moteur de recherche par mots-clés ; 
    - Envoyez par courriel ou partagez n’importe quel article.
